DROP TABLE IF EXISTS `cs_admin_menu`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `cs_admin_menu` (
  `sid` int(11) NOT NULL COMMENT '站点id',
  `id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL COMMENT '菜单名称',
  `parent_id` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '父级ID',
  `app` varchar(50) NOT NULL COMMENT '模块名称',
  `controller` varchar(50) NOT NULL COMMENT '控制器名称',
  `action` varchar(100) NOT NULL COMMENT '控制器方法名称',
  `parameter` varchar(255) DEFAULT NULL COMMENT '参数',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '类型(“权限认证+菜单”表示加入后台权限管理，纯粹是菜单项请不要选择此项  0-菜单项 1-菜单+权限认证)',
  `status` tinyint(1) unsigned NOT NULL COMMENT '菜单状态(0-不显示  1-显示)',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `sort_order` int(9) unsigned DEFAULT '50' COMMENT '排序',
  `pingtai` int(11) unsigned NOT NULL DEFAULT '3' COMMENT '1卖家2买家3平台',
  PRIMARY KEY (`id`),
  KEY `sid` (`sid`)
) ENGINE=MyISAM AUTO_INCREMENT=12345 DEFAULT CHARSET=utf8 COMMENT='后台菜单项';
/*!40101 SET character_set_client = @saved_cs_client */;

