--
-- Table structure for table `order_tourist`
--

DROP TABLE IF EXISTS `order_tourist`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `order_tourist` (
  `sid` int(11) NOT NULL COMMENT '站点id',
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(11) unsigned NOT NULL COMMENT '订单表主键ID',
  `name` varchar(50) NOT NULL COMMENT '游客姓名',
  `email` varchar(100) DEFAULT NULL COMMENT '邮件地址',
  `phone_num` char(11) DEFAULT NULL COMMENT '游客手机号码',
  `id_card_type` tinyint(1) unsigned DEFAULT '1' COMMENT '证件类型 1-身份证2 护照 3港澳通行证4军官证5其他',
  `id_number` char(18) DEFAULT NULL COMMENT '证件号码',
  `birth` varchar(8) DEFAULT NULL COMMENT '出生年',
  `note` varchar(200) DEFAULT NULL COMMENT '出游人备注\n',
  `gender` tinyint(1) DEFAULT NULL COMMENT '0保密 1男 2女',
  `singleroom` tinyint(4) DEFAULT '0' COMMENT '0否1是',
  `type` tinyint(8) DEFAULT '1' COMMENT '0成人 1儿童',
  PRIMARY KEY (`id`),
  KEY `sid` (`sid`),
  KEY `id_number` (`id_number`)
) ENGINE=MyISAM AUTO_INCREMENT=44486 DEFAULT CHARSET=utf8 COMMENT='订单游客信息表';
/*!40101 SET character_set_client = @saved_cs_client */;

